[{"location":"","page":"-","title":"-","text":"Pages   = [\"notebook.md\"]","category":"page"},{"location":"notebook/","page":"Notebooks","title":"Notebooks","text":"<style>\n    table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    pre, div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"d4856881e3bf3156d94aa8eed4dae22c7e4951199acfd705bd86715a076ff622\"\n    julia_version = \"1.9.0\"\n-->\n\n\n\n\n\n\n<pre class='language-julia'><code class='language-julia'># by default download 1 file per sample\nLHC_AGC.download_data()</code></pre>\n\n\n\n<div class=\"markdown\"><h2>Introduction: exploring <span class=\"tex\">$t\\bar&#123;t&#125;$</span></h2>\n</div>\n\n\n\n\n<pre class='language-julia'><code class='language-julia'>njet_hist = Hist1D((length(x) for x in tt_tree.jet_pt), 0:16; overflow=true)</code></pre>\n<div style=\"display: flex;\">\n    <div style=\"float:left; margin:5px\"><svg width=\"250\" height=\"200\" version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\">\n    <polyline points=\"12.5,180.0,12.5,180.0,26.5625,180.0,26.5625,180.0,40.625,180.0,40.625,179.86096628432395,54.6875,179.86096628432395,54.6875,177.97010775112966,68.75,177.97010775112966,68.75,169.85053875564824,82.8125,169.85053875564824,82.8125,147.8275981925617,96.875,147.8275981925617,96.875,110.26068821689259,110.9375,110.26068821689259,110.9375,67.32707681612791,125.0,67.32707681612791,125.0,34.09801876955161,139.0625,34.09801876955161,139.0625,19.999999999999996,153.125,19.999999999999996,153.125,26.33993743482794,167.1875,26.33993743482794,167.1875,39.019812304483835,181.25,39.019812304483835,181.25,73.91727493917276,195.3125,73.91727493917276,195.3125,100.2780674313521,209.375,100.2780674313521,209.375,121.91171359054569,223.4375,121.91171359054569,223.4375,88.6826555439694,237.5,88.6826555439694,237.5,180.0,12.5,180.0\" stroke=\"black\" fill=\"#ffffff00\" stroke-width=\"1\"/>\n    <polyline points=\"12.5,180.0,237.5,180.0\" stroke=\"black\" stroke-width=\"1\"/>\n    <text x=\"12.5\" y=\"190.0\" dominant-baseline=\"middle\" text-anchor=\"start\" fill=\"black\">0.0</text>\n    <text x=\"237.5\" y=\"190.0\" dominant-baseline=\"middle\" text-anchor=\"end\" fill=\"black\">16.0</text>\n</svg>\n</div>\n    <div style=\"float:left; margin:5px; max-width: 50%; display:flex; justify-content:center; align-items:center;\">\n        <ul>\n            <li>edges: 0:16</li>\n            <li>bin counts: [0, 0, 5, 73, 365, 1157, 2508, 4052, 5247, 5754, 5526, 5070, 3815, 2867, 2089, 3284]</li>\n            <li>maximum count: 5754</li>\n            <li>total count: 41812</li>\n        </ul>\n    </div>\n</div>\n\n\n\n<pre class='language-julia'><code class='language-julia'># chop off the overflow bin\nintegral(restrict(njet_hist, 0, 15))</code></pre>\n<pre id='var-hash143363' class='code-output documenter-example-output'>38528</pre>\n\n<pre class='language-julia'><code class='language-julia'>with_terminal() do\n    # this is a lazy generator, evident since it has 0 allocation\n    global _c = @time (count(&gt;(25), x) for x in tt_tree.jet_pt)\nend</code></pre>\n<pre id=\"plutouiterminal\">\n  0.000005 seconds (1 allocation: 1.766 KiB)\n</pre>\n\n\n<pre class='language-julia'><code class='language-julia'>with_terminal() do\n    # and the loop over this generator is fully inferred, which means it's fast\n    @code_warntype Hist1D(_c, 2:10)\nend</code></pre>\n<pre id=\"plutouiterminal\">\nMethodInstance for FHist.Hist1D(::Base.Generator{UnROOT.LazyBranch{SubArray{Float32, 1, Vector{Float32}, Tuple{UnitRange{Int64}}, true}, UnROOT.Nooffsetjagg, ArraysOfArrays.VectorOfVectors{Float32, Vector{Float32}, Vector{Int32}, Vector{Tuple{}}}}, Main.var\\\"workspace#5\\\".var\\\"#2#4\\\"}, ::UnitRange{Int64})\n  from FHist.Hist1D(\u001b[90mA\u001b[39m, \u001b[90mr\u001b[39m::\u001b[1mAbstractRange\u001b[22m; overflow)\u001b[90m @\u001b[39m \u001b[90mFHist\u001b[39m \u001b[90m~/.julia/packages/FHist/50GfA/src/\u001b[39m\u001b[90m\u001b[4mhist1d.jl:158\u001b[24m\u001b[39m\nArguments\n  #self#\u001b[36m::Type{FHist.Hist1D}\u001b[39m\n  A\u001b[36m::Base.Generator{UnROOT.LazyBranch{SubArray{Float32, 1, Vector{Float32}, Tuple{UnitRange{Int64}}, true}, UnROOT.Nooffsetjagg, ArraysOfArrays.VectorOfVectors{Float32, Vector{Float32}, Vector{Int32}, Vector{Tuple{}}}}, Main.var\\\"workspace#5\\\".var\\\"#2#4\\\"}\u001b[39m\n  r\u001b[36m::UnitRange{Int64}\u001b[39m\nBody\u001b[36m::FHist.Hist1D{Int64, Tuple{UnitRange{Int64}}}\u001b[39m\n\u001b[90m1 ─\u001b[39m %1 = FHist.:(var\\\"#Hist1D#10\\\")(FHist._default_overflow, #self#, A, r)\u001b[36m::FHist.Hist1D{Int64, Tuple{UnitRange{Int64}}}\u001b[39m\n\u001b[90m└──\u001b[39m      return %1\n</pre>\n\n\n<pre class='language-julia'><code class='language-julia'>Hist1D(_c, 2:10)</code></pre>\n<div style=\"display: flex;\">\n    <div style=\"float:left; margin:5px\"><svg width=\"250\" height=\"200\" version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\">\n    <polyline points=\"12.5,180.0,12.5,165.36877573942343,40.625,165.36877573942343,40.625,119.12392362411082,68.75,119.12392362411082,68.75,47.719955073006346,96.875,47.719955073006346,96.875,19.999999999999996,125.0,19.999999999999996,125.0,54.20441782104079,153.125,54.20441782104079,153.125,106.90378135529764,181.25,106.90378135529764,181.25,144.73230999625608,209.375,144.73230999625608,209.375,166.2972669412205,237.5,166.2972669412205,237.5,180.0,12.5,180.0\" stroke=\"black\" fill=\"#ffffff00\" stroke-width=\"1\"/>\n    <polyline points=\"12.5,180.0,237.5,180.0\" stroke=\"black\" stroke-width=\"1\"/>\n    <text x=\"12.5\" y=\"190.0\" dominant-baseline=\"middle\" text-anchor=\"start\" fill=\"black\">2.0</text>\n    <text x=\"237.5\" y=\"190.0\" dominant-baseline=\"middle\" text-anchor=\"end\" fill=\"black\">10.0</text>\n</svg>\n</div>\n    <div style=\"float:left; margin:5px; max-width: 50%; display:flex; justify-content:center; align-items:center;\">\n        <ul>\n            <li>edges: 2:10</li>\n            <li>bin counts: [977, 4065, 8833, 10684, 8400, 4881, 2355, 915]</li>\n            <li>maximum count: 10684</li>\n            <li>total count: 41110</li>\n        </ul>\n    </div>\n</div>\n\n\n\n\n<div class=\"markdown\"><h2><span class=\"tex\">$t\\bar&#123;t&#125;$</span> kinematic reconstruction of the top mass.</h2>\n<p>You can find the full function in the <code>main_looper.jl</code> file, and look below this cell to look at the result of calling the function. Here we present a snippt view of the main three parts of the main looper:</p>\n<h3>Basic cuts</h3>\n<pre><code class=\"language-julia\">\t# single lepton requirement\n\t# Avoid allocation:\n\t# - bad example: &#96;length&#40;electron_pt .&gt; 25&#41;&#96;\n\tif count&#40;&gt;&#40;25&#41;, electron_pt&#41; &#43; count&#40;&gt;&#40;25&#41;, muon_pt&#41; &#33;&#61; 1\n\t\tcontinue\n\tend\n\n\t# at least 4 jets\n\t&#40;; jet_pt&#41; &#61; evt\n\t# can&#39;t avoid allocation since we need this mask later\n\tjet_pt_mask &#61; jet_pt .&gt; 25\n\tcount&#40;jet_pt_mask&#41; &lt; 4 &amp;&amp; continue\n\n\t# at least 2 btag\n\t# use view to avoid allocation\n\tjet_btag &#61; @view evt.jet_btag&#91;jet_pt_mask&#93;\n\tcount&#40;&gt;&#61;&#40;0.5&#41;, jet_btag&#41; &lt; 2 &amp;&amp; continue\n\t&#40;; jet_px, jet_py, jet_pz, jet_mass&#41; &#61; evt</code></pre>\n<h3>Tri-jet combinatorics</h3>\n<pre><code class=\"language-julia\">\t# construct jet lorentz vector\n\tjet_p4 &#61; @views fromPxPyPzM.&#40;jet_px&#91;jet_pt_mask&#93;, jet_py&#91;jet_pt_mask&#93;, jet_pz&#91;jet_pt_mask&#93;, jet_mass&#91;jet_pt_mask&#93;&#41;\n\n\t# tri jet combinatorics\n\tmax_pt &#61; -Inf\n\tlocal best_mass\n\t\n\t# 1. all tri-jet combinations\n\t# again it&#39;s lazy, avoid allocating a bunch of 3-tuples\n\tfor comb in Combinations&#40;Njets, 3&#41;\n\t\tp4s &#61; @view jet_p4&#91;comb&#93;\n\t\tbtags &#61; @view jet_btag&#91;comb&#93;\n\t\t# 2. keep those maximum&#40;btags1,2,3&#41; &gt; 0.5\n\t\tmaximum&#40;btags&#41; &lt; 0.5 &amp;&amp; continue\n\t\ttri &#61; sum&#40;p4s&#41;\n\t\t_pt &#61; pt&#40;tri&#41;\n\t\t# 3. pick the tri-p4 with highest tri-pt\n\t\tif _pt &gt; max_pt\n\t\t\tmax_pt &#61; _pt\n\t\t\tbest_mass &#61; mass&#40;tri&#41;\n\t\tend\n\tend\n</code></pre>\n</div>\n\n<pre class='language-julia'><code class='language-julia'># let's not weight this one\nres = @time LHC_AGC.get_histo(:ttbar; wgt=1.0, n_files_max_per_sample=1);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>begin\n    stairs(res, \n        axis=(xlabel=\"mass (GeV)\", ylabel=\"# events\", \n        limits=(0,375,0,1000),\n        yticks=0:200:1000,\n        )\n    )\n    errorbars!(res)\n    vlines!(175, color=:grey, linestyle=:dash)\n    text!(180, 20, text = L\"m_t = 175 \\mathrm{GeV}\")\n    current_figure()\nend</code></pre>\n<img src=\"data:image/png;base64,\">\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"notebook/","page":"Notebooks","title":"Notebooks","text":"EditURL = \"https://github.com/Moelf/LHC_AGC.jl/blob/master/nothing\"","category":"page"}]
